import React from 'react';
import GoBackButton from '../../components/UI/GoBackButton/GoBackButton';

const CompanyMarketingSeparateNewsPage = () => {
	return (
		<div>
			<h1>title</h1>
			<GoBackButton toLink={'/company-marketing-news'} />
			<div className="row">
				<div className="section-container" style={{ maxWidth: '1200px', width: '100%' }}></div>
			</div>
		</div>
	);
};

export default CompanyMarketingSeparateNewsPage;
